import { html, svg, repeat, classMap, styleMap, ifDefined, unsafeHTML, scopeTag } from "@ui5/webcomponents-base/dist/renderer/LitRenderer.js";
import type UI5Element from "@ui5/webcomponents-base/dist/UI5Element.js";
import type ColorPaletteItem from "../../ColorPaletteItem.js";
import type { ClassMapValue } from "@ui5/webcomponents-base/dist/types.js";

function block0 (this: ColorPaletteItem, context: UI5Element, tags: string[], suffix: string | undefined) { return html`<div class="${classMap(this.classes.root as ClassMapValue)}" style="${styleMap(this.styles.root)}" value="${ifDefined(this.value)}" tabindex="${ifDefined(this.forcedTabIndex)}" role="button" aria-label="${ifDefined(this.colorLabel)} - ${ifDefined(this.index)}: ${ifDefined(this.value)}" title="${ifDefined(this.colorLabel)} - ${ifDefined(this.index)}: ${ifDefined(this.value)}" ?disabled="${this._disabled}"></div>`;}


